import React from 'react'
import {
    Col,
  Dropdown,
  DropdownToggle,
  DropdownMenu,
  DropdownItem,
} from 'reactstrap';

function Dropdown2() {
  return (
    <Dropdown isOpen={dropdownOpen} toggle={toggle} {...props}>
    <DropdownToggle caret size="lg">
      Large Button
    </DropdownToggle>
    <DropdownMenu>
      <DropdownItem header>Header</DropdownItem>
      <DropdownItem>Action</DropdownItem>
    </DropdownMenu>
  </Dropdown>
  )
}

export default Dropdown2
